import React from 'react';

const Contact = () => {
  return (
    <section id="contact" className="text-white py-16 px-8">
      <div className="max-w-3xl mx-auto text-center">
        <h2 className="text-4xl font-bold text-primary mb-6">Contact Me</h2>
        <p className="text-gray-300 mb-4">Feel free to reach out via email or LinkedIn!</p>
        <p className="text-lg text-primary">Email: roshithakommana18@gmail.com</p>
        <p className="text-lg">LinkedIn: <a href="https://www.linkedin.com/in/roshitha-kommana-b69828257" className="underline text-primary">Visit Profile</a></p>
      </div>
    </section>
  );
};

export default Contact;
